"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Torticollis in children (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/torticollis-in-children-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H11692743\">",
"      <span class=\"h1\">",
"       What is torticollis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Torticollis is the medical term for a twisted neck. The condition is sometimes called &ldquo;wry neck.&rdquo; In torticollis, the head tilts to 1 side and the chin points in the opposite direction.",
"     </p>",
"     <p>",
"      Torticollis is common in children, and babies can have it at birth. The medical term for this is &ldquo;congenital torticollis.&rdquo; The word &ldquo;congenital&rdquo; means a condition a person is born with. Doctors do not know the exact cause of congenital torticollis, but it can run in families.",
"     </p>",
"     <p>",
"      Torticollis can also be caused by another medical condition, such as a muscle strain, bad reaction to medicine, or a problem with the spine that makes the neck twist. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11692758\">",
"      <span class=\"h1\">",
"       What are the symptoms of torticollis?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms of congenital torticollis can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Head tilted to 1 side",
"       </li>",
"       <li>",
"        Chin pointed to the opposite side from the head tilt. For example, if a baby&rsquo;s head tilts to the right, the chin points to the left. &nbsp;",
"       </li>",
"       <li>",
"        Lump on the side of the neck that the head tilts toward. For example, if a baby&rsquo;s head tilts to the right, the lump is on the right side of the neck.",
"       </li>",
"       <li>",
"        Face that looks uneven, with 1 side that does not match the other",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Symptoms of torticollis caused by a medical condition can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Pain",
"       </li>",
"       <li>",
"        Trouble moving the head, neck, or both &nbsp;",
"       </li>",
"       <li>",
"        Vomiting, looking pale, being irritable or sleepy, and being less coordinated than normal. Babies and children can have &ldquo;attacks&rdquo; of these symptoms that last a few hours or days. Then the symptoms go away on their own.",
"       </li>",
"       <li>",
"        Tight jaw muscles, muscle spasms, and trouble speaking. These torticollis symptoms can be caused by a bad reaction to certain medicines.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      In babies born with torticollis, symptoms usually show up by 2 to 4 weeks after birth. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11692772\">",
"      <span class=\"h1\">",
"       Will my child need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Maybe. The doctor or nurse should be able to tell if your child has torticollis by doing an exam. Depending on the type of torticollis, he or she might order imaging tests. These can include ultrasound, X-ray, CT, or MRI scans. Imaging tests create pictures of the inside of the body. They can show the cause of torticollis, including other conditions that need treatment.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11692789\">",
"      <span class=\"h1\">",
"       How is torticollis treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Congenital torticollis sometimes goes away without treatment, but not always. If congenital torticollis is not treated, it can make 1 side of a child&rsquo;s face look different from the other side. This can be permanent.",
"     </p>",
"     <p>",
"      Treatments for congenital torticollis can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Stretches and position changes you do with your baby at home. These can help straighten out the neck. Your doctor or nurse will tell you if you should try these.",
"       </li>",
"       <li>",
"        Physical therapy",
"       </li>",
"       <li>",
"        Surgery",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      For torticollis caused by another condition, treatment depends on the cause. Treatments can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Medicine to relieve pain, relax tight muscles, or fight infection, if the torticollis is caused by infection",
"       </li>",
"       <li>",
"        A collar that supports and straightens the neck, called a &ldquo;cervical collar&rdquo;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If a child&rsquo;s neck is twisted in an accident, he or she needs treatment right away. Call 9-1-1 and do not move the child.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H11692804\">",
"      <span class=\"h1\">",
"       More on this topic",
